function Cart(props) {
  
  const cartItems=<ol>{[{id:1, name: 'pizza', quantity:3, price: 35}].map((item)=><li>{item.name}</li>)}</ol>

  return (
    <>
      {cartItems}
      <span>
        Total Amount
      </span>
      <span></span>
    </>
  );
}

export default Cart
